import React from 'react';
import './App.css';
import { BsLinkedin, BsFacebook, BsGithub,BsInstagram } from "react-icons/bs";

function App() {
  return (
    <main className='main'>

    <div className="title">
     <div className='titleBar'>
       <a href='#'>
       <img className='avatar' src={require('./diego.png')} />
       </a>
     </div>

     <div className='privateData'><BsLinkedin/> <BsFacebook/> <BsGithub/> <BsInstagram/>
     </div>
     <div className='menuBar'>
     <a href='#' >Home</a> 
     <a href='#' >sobre</a>
     <a href='#' >Habilidades</a>
     <a href='#' >Projetos</a>
     </div>
    </div>


    </main>

  );
}

export default App;
